{'id': 2193, 'project': {'name': 'Farcaster Attestation', 'description': 'Farcaster Attestation is bringing Farcaster wallet verification on-chain to the Optimism Mainnet. Traditionally, Farcaster wallet verification data is only accessible through the Farcaster Hub, which cannot be utilized directly on Optimism Mainnet via Solidity smart contracts. This creates a centralization issue in the Retro Funding EAS schema, limiting the authorized attester to a single wallet, as it requires verification from a centralized backend.

Farcaster Attestation resolves this centralization problem by enabling anyone to attest their Farcaster data permissionlessly.

We have replicated the Retro Funding Project and Metadata Schema to test the integration with Farcaster Attestation. For more information, refer to the Links section.', 'website': ''}, 'reviewer': {'userFID': 2306, 'ethAddress': '0x0000000000000000000000000000000000000000'}, 'context': {'ecosystems': [{'name': 'Optimism', 'tags': [{'category': 'Governance', 'subcategory': 'Infra & Tooling', 'round': 'RF6'}]}], 'userInterface': 'Impact Garden'}, 'contributions': [{'name': 'Farcaster Attestation', 'description': 'Farcaster Attestation', 'website': ''}], 'impactAttestations': [{'name': 'Likely to Recommend', 'type': 'numeric', 'value': 8}, {'name': 'Feeling if didnt exist', 'type': 'numeric', 'value': 2}, {'name': 'Governance Knowledge', 'type': 'numeric', 'value': ''}, {'name': 'Useful for Understanding', 'type': 'numeric', 'value': ''}, {'name': 'Effective for Improvements', 'type': 'numeric', 'value': ''}, {'name': 'Why Effective for Improvements', 'type': 'string', 'value': ''}, {'name': 'Text Review', 'type': 'string', 'value': ''}]}

