{'id': 2183, 'project': {'name': 'Praise', 'description': 'Praise is an open-source reputation and rewards system designed to recognize, track, and verify community contributions across decentralized ecosystems. By offering simple tools that integrate with both Discord and Farcaster, Praise empowers communities to mint on-chain attestations and cultivate identity and reputation.
