{'id': 2198, 'project': {'name': 'Flexy', 'description': 'Flexy offers DeFi users the most seamless way to obtain tokens and gas on various networks. At its core, Flexy works as a cross-chain bridge that can deliver specific ERC20s and gas in a single, gasless transaction. Flexy is a public good that offers completely free bridging for stablecoins across OP stack L2s. Flexy charges a minimal 0.1% fee for non-stablecoin transfers to offset operational costs (liquidity provisioning).

Utilizing EIP-2612, users need only sign a single off-chain signature to initiate a bridge transaction, reducing user friction and abstracting away crypto complexities. All values are denominated in USD to make value transfer clear and easy to understand.

Flexy can be integrated into any dApp via the Flexy widget, installable via npm. The Flexy widget allows projects across DeFi to add a tailored cross-chain bridge directly into their own dApp to deliver ERC20s and gas that users need to interact with the contracts on their supported chains.', 'website': 'https://www.flexy.tech/'}, 'reviewer': {'userFID': '230991', 'ethAddress': '0x75536cf4f01c2bfa528f5c74ddc1232db3af3ee5'}, 'context': {'ecosystems': [{'name': 'Optimism', 'tags': [{'category': 'Governance', 'subcategory': 'Infra & Tooling', 'round': 'RF6'}]}], 'userInterface': 'Impact Garden'}, 'contributions': [{'name': 'Flexy', 'description': 'Flexy', 'website': 'https://www.flexy.tech/'}], 'impactAttestations': [{'name': 'Likely to Recommend', 'type': 'numeric', 'value': ''}, {'name': 'Feeling if didnt exist', 'type': 'numeric', 'value': 1}, {'name': 'Governance Knowledge', 'type': 'numeric', 'value': ''}, {'name': 'Useful for Understanding', 'type': 'numeric', 'value': ''}, {'name': 'Effective for Improvements', 'type': 'numeric', 'value': ''}, {'name': 'Why Effective for Improvements', 'type': 'string', 'value': ''}, {'name': 'Text Review', 'type': 'string', 'value': "I've never used this"}]}

